package com.yskj.models;import lombok.Data;import java.math.BigDecimal;//表名称 indemnity@Datapublic class Indemnity extends BaseEntity {	private static final long serialVersionUID = 1L;	public Indemnity() {		super();	}	    //用户ID    private String userID;    //职位id    private String positionID;    //金额    private BigDecimal money;    //1保证金赔偿 2...    private Integer type;    //状态，默认为0未激活，1已激活，2已付款    private Integer status;    //订单编码    private String orderNumber;    private String title;}